import DataTable from '../components/DataTable';
import Axios from "axios";

function ListBoxes() {

  const columns = [
    {
      Header: "Receiver",
      accessor: "receiver",
    },
    {
      Header: "Weight",
      accessor: "weight",
    },
    {
      Header: "Box Colour",
      accessor: "color",
      Cell: row => {
        row.styles['backgroundColor'] = row.value;
        return "";
      }
    },
    {
      Header: "Shipping cost",
      accessor: "cost",
    }
  ];

  const cost = {
    "Sweden": 1.3,
    "China": 4,
    "Brazil": 8.6,
    "Australia": 7.4
  };
  var list = [];

  const getBoxes = () => {
    Axios.get("http://localhost:3001/getboxes").then((response) => {
      let data = response.data;
      console.log("hello");
      data.forEach((element) => {
        let map = {
          id: element.id,
          receiver: element.name,
          weight: element.weight,
          color: "green",
          cost: element.weight * cost[element.country],
        };
        list.push(map);
      });
      return list;
    });
  };
  //const data = getBoxes();
  return (
    <DataTable 
    columns={columns}
    data={
      Axios.get("http://localhost:3001/getboxes").then((response) => {
      let data = response.data;
      data.map((element) => {
        let map = {
          id: element.id,
          receiver: element.name,
          weight: element.weight,
          color: "green",
          cost: element.weight * cost[element.country],
        };
        return map;
      });
    })

    }
    />
  );
}

export default ListBoxes;
